@ValaAfshar WHEN THINGS GO WRONG,DON’T GO WRONG WITH THEM. I WANT GLORY. I WANT TO BE GOD.

Most of the noise in our souls is generated by our attempts to control the uncontrollable. We grasp after the wind. We rage,we fear &amp; finally despair. 

BE STILL MY SOUL. CHRIST RULED THE STORMS. https://t.co/XDiRWq2D5h
